func findLongestWord(s string, dictionary []string) string {
	sort.Slice(dictionary, func (a, b int) bool {
		if len(dictionary[a]) == len(dictionary[b]) {
			return dictionary[a] < dictionary[b]
		}
		return len(dictionary[a]) > len(dictionary[b])
	})

TOP:
	for _, word := range dictionary {
		if len(word) > len(s) {
			continue
		}
		copyS := s
		for _, r := range word {
			index := strings.Index(copyS, string(r))
			if index == -1 {
				continue TOP
			}
			copyS = copyS[index + 1:]
		}
		return word
	}
	return ""
}

func replace(s string, index int, c string) string {
	if len(c) != 1 {
		return s
	}
	runes := []rune(s)
	runes[index] = []rune(c)[0]
	return string(runes)
}

